fragment:
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:soft_palate_cancer rdfs:subClassOf :oral_cavity_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :soft_palate ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "malignant tumor of soft palate"@en,
        "malignant tumor of the soft Palate"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:burkitt_lymphoma rdfs:subClassOf :mature_b_cell_neoplasm ;
    :has_definition "A mature B-cell neoplasm of B-cells found in the germinal center." ;
    :has_exact_synonym "Burkitt lymphoma/leukaemia"@en,
        "Burkitt's Lymphoma"@en,
        "Burkitt's tumor"@en,
        "Burkitt's tumor or lymphoma"@en,
        "malignant lymphoma, Burkitt's type"@en,
        "small Non-Cleaved cell Lymphoma, Burkitt's type"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:holocarboxylase_synthetase_deficiency rdfs:subClassOf :multiple_carboxylase_deficiency ;
    :has_definition "A multiple carboxylase deficiency that involves a deficiency in holocarboxylase synthetase." ;
    :has_exact_synonym "Biotin-(propionyl-CoA-carboxylase) ligase deficiency"@en,
        "Multiple carboxylase deficiency - neonatal onset"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_vascular_insufficiency_of_intestine rdfs:subClassOf :intestinal_disease ;
    :has_exact_synonym "acute GIT vascular insuffic."@en,
        "acute gastrointestinal tract vascular insuffic."@en,
        "acute intestinal Ischemia"@en,
        "acute intestinal vascular insufficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:scarlet_fever rdfs:subClassOf :upper_respiratory_tract_disease ;
    :has_definition "An upper respiratory tract disease described as an acute contagious disease caused by Group A bacteria of the genus Streptococcus (especially various strains of S. pyogenes) and characterized by inflammation of the nose, throat, and mouth, generalized toxemia, and a red rash." ;
    :has_exact_synonym "Scarlatina"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:upper_gum_cancer rdfs:subClassOf :gum_cancer ;
    :has_exact_synonym "malignant tumor of upper gingiva"@en,
        "malignant tumour of upper gum"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gum_cancer rdfs:subClassOf :oral_cavity_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :gingiva ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "malignant Gingival tumor"@en,
        "malignant neoplasm of gum"@en,
        "malignant neoplasm of other sites of gum"@en,
        "malignant tumor of gum"@en,
        "malignant tumour of gingiva"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:herpetic_whitlow rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :foot ;
                            rdf:rest [ rdf:first :hand ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :enlargement_of_lymph_nodes ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        :herpes_simplex ;
    :has_definition "A herpes simplex that results_in infection located_in skin of the finger, toe, or thumb, has_material_basis_in Human herpesvirus 1 and has_material_basis_in Human herpesvirus 2 and has_symptom lesions, has_symptom fever, and has_symptom swollen lymph nodes." ;
    :has_exact_synonym "Herpetic felon"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:peyronie_s_disease rdfs:subClassOf :penile_disease ;
    :has_exact_synonym "Induratio penis plastica"@en,
        "Peyronie disease"@en,
        "Peyronie's Fibromatosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oral_cavity_cancer rdfs:subClassOf :gastrointestinal_system_cancer,
        :mouth_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :oral_cavity ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A gastrointestinal system cancer that is located_in the oral cavity." ;
    :has_exact_synonym "malignant neoplasm of floor of mouth"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:recurrent_hypersomnia rdfs:subClassOf :sleep_disorder ;
    :has_definition "A sleep disorder that involves recurring bouts of excessive amounts of sleepiness." ;
    :has_exact_synonym "primary recurrent hypersomnia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diplegia_of_upper_limb rdfs:subClassOf :nervous_system_disease ;
    :has_exact_synonym "Diplegia of upper limbs"@en,
        "Diplegia, upper"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:measles rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :measles_morbillivirus ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :conjunctivitis ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in infection located_in skin, has_material_basis_in Measles virus, which is transmitted_by contact with oronasal secretions, or semen of an infected person. The infection has_symptom fever, has_symptom cough, has_symptom coryza, has_symptom conjunctivitis, and has_symptom maculopapular, erythematous rash." ;
    :has_exact_synonym "morbilli"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hodgkin_s_lymphoma_lymphocytic_depletion rdfs:subClassOf :hodgkin_s_lymphoma ;
    :has_exact_synonym "Hodgkin lymphoma, lymphocyte depletion"@en,
        "Hodgkin's disease, lymphocytic depletion"@en,
        "Hodgkin's lymphocytic depletion of unspecified site"@en,
        "Lymphocyte-Depleted Classical Hodgkin Lymphoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nervous_system_disease rdfs:subClassOf :disease_of_anatomical_entity ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :nervous_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A disease of anatomical entity that is located_in the central nervous system or located_in the peripheral nervous system." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:upper_lip_cancer rdfs:subClassOf :lip_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :upper_lip ] ;
                            rdf:rest :nil ] ] ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_intestinal_vascular_insufficiency rdfs:subClassOf :intestinal_disease ;
    :has_exact_synonym "CMI - chronic mesenteric ischaemia"@en,
        "chronic mesenteric ischemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prostate_carcinoma_in_situ rdfs:subClassOf :in_situ_carcinoma,
        :prostate_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :in_situ_carcinoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :prostate_gland ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An in situ carcinoma that is located_in the prostate." ;
    :has_exact_synonym "PIN III"@en,
        "carcinoma in situ of prostate"@en,
        "grade III PIN"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:uvula_cancer rdfs:subClassOf :soft_palate_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :palatine_uvula ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "malignant Uvular tumor"@en,
        "malignant tumor of uvula"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:phlebitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :vein_disease ;
    :has_definition "A vein disease that is characterized by inflammation of a vein." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hodgkin_s_paragranuloma rdfs:subClassOf :hodgkin_s_lymphoma ;
    :has_exact_synonym "Hodgkin paragranuloma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:duodenitis rdfs:subClassOf :intestinal_disease ;
    :has_exact_synonym "Hemorrhagic duodenitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tongue_cancer rdfs:subClassOf :oral_cavity_cancer,
        :tongue_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :tongue ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "malignant neoplasm of tongue"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vasculitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :blood_vessel ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :vascular_disease ;
    :has_definition "A vascular disease that is characterized by inflammation of the blood vessels." ;
    :has_exact_synonym "Angiitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hodgkin_s_granuloma rdfs:subClassOf :hodgkin_s_lymphoma ;
    :has_exact_synonym "Hodgkin granuloma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hodgkin_s_lymphoma_mixed_cellularity rdfs:subClassOf :hodgkin_s_lymphoma ;
    :has_exact_synonym "Hodgkin's disease, mixed cellularity"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chickenpox rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anorexia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pharynx_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :contact_transmission ;
                            rdf:rest [ rdf:first :droplet_spread_transmission ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :blister ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :human_alphaherpesvirus_3 ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in infection located_in skin, has_material_basis_in Human herpesvirus 3, which is transmitted_by direct contact with secretions from the rash, or transmitted_by droplet spread of respiratory secretions. The infection has_symptom anorexia, has_symptom myalgia, has_symptom nausea, has_symptom fever, has_symptom headache, has_symptom sore throat, and has_symptom blisters." ;
    :has_exact_match "MESH:D002644" ;
    :has_exact_synonym "varicella"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vein_disease rdfs:subClassOf :vascular_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :vein ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A vascular disease that is located_in a vein." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:postcricoid_region_cancer rdfs:subClassOf :hypopharynx_cancer ;
    :has_exact_synonym "malignant Postcricoid tumor"@en,
        "malignant tumor of pharyngoesophageal junction"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lip_carcinoma_in_situ rdfs:subClassOf :lip_disease,
        :oral_cavity_carcinoma_in_situ ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :in_situ_carcinoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :lip ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An oral cavity carcinoma in situ that is located_in the lip." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aryepiglottic_fold_cancer rdfs:subClassOf :hypopharynx_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :aryepiglottic_fold ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "malignant neoplasm of hypopharyngeal aspect of aryepiglottic fold"@en,
        "malignant tumor aryepiglottic fold - hypopharyngeal aspect"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:maxillary_sinus_cholesteatoma rdfs:subClassOf :cholesteatoma,
        :paranasal_sinus_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cholesteatoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :maxillary_sinus ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A cholesteatoma located_in paranasal sinus." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:eating_disorder rdfs:subClassOf :specific_developmental_disorder ;
    :has_definition "A specific developmental disorder that is characterized by abnormal eating habits that may involve either insufficient or excessive food intake to the detriment of an individual's physical and emotional health." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:viral_exanthem rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :viruses ],
        :exanthem,
        :viral_infectious_disease .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alcoholic_gastritis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_disease_driver ;
            owl:someValuesFrom :alcohol ],
        :gastritis ;
    :has_exact_synonym "Alcoholic gastritis, with hemorrhage"@en,
        "Alcoholic gastritis, without mention of hemorrhage"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myeloid_sarcoma rdfs:subClassOf :hematologic_cancer ;
    :has_exact_synonym "Chloroma"@en,
        "Extramedullary Myeloid tumor"@en,
        "Granulocytic sarcoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:skin_carcinoma_in_situ rdfs:subClassOf :in_situ_carcinoma,
        :skin_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :in_situ_carcinoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :zone_of_skin ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A carcinoma in situ that is characterized by the spread of cancer in skin and the lack of invasion of surrounding tissues." ;
    :has_exact_synonym "Cutaneous carcinoma in situ"@en ;
    :has_related_synonym "carcinoma in situ of skin"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tonsillar_pillar_cancer rdfs:subClassOf :oropharynx_cancer ;
    :has_exact_synonym "malignant neoplasm of tonsillar pillar"@en,
        "malignant neoplasm of tonsillar pillars, posterior"@en,
        "malignant tumor of tonsillar pillar"@en,
        "malignant tumour of tonsillar pillar"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anorexia_nervosa rdfs:subClassOf :eating_disorder ;
    :has_definition "An eating disorder characterized by refusal to maintain a healthy body weight, and an obsessive fear of gaining weight due to a distorted self image." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cholesteatoma rdfs:subClassOf :keratosis ;
    :has_definition "A keratosis that is characterized by keratinizing squamous epithelium located in middle ear and/or mastoid, subepithelial connective tissue and by the progressive accumulation of keratin debris with or without surrounding inflammatory reaction." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mycosis_fungoides rdfs:subClassOf :primary_cutaneous_t_cell_non_hodgkin_lymphoma ;
    :has_exact_synonym "mycosis fungoides lymphoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myeloid_leukemia rdfs:subClassOf :leukemia ;
    :has_definition "A leukemia that is located_in myeloid tissue." ;
    :has_exact_synonym "Non-Lymphocytic Leukemia"@en,
        "leukaemia myelogenous"@en,
        "leukemia myelogenous"@en,
        "myeloid granulocytic leukaemia"@en,
        "myeloid granulocytic leukemia"@en,
        "myeloid leukaemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neuropathy rdfs:subClassOf :peripheral_nervous_system_disease ;
    :has_definition "A nervous system disease that is located_in nerves or nerve cells." ;
    :has_exact_synonym "peripheral neuropathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cheek_mucosa_cancer rdfs:subClassOf :oral_cavity_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :buccal_mucosa ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "malignant neoplasm of buccal mucosa"@en,
        "malignant neoplasm of cheek, inner aspect"@en,
        "malignant neoplasm of the Buccal Mucosa"@en,
        "malignant tumor of buccal mucosa"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:genital_herpes rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        :herpes_simplex ;
    :has_definition "A herpes simplex that results_in infection located_in genital system, or located_in rectum, has_material_basis_in Human herpesvirus 1 or has_material_basis_in Human herpesvirus 2, which is transmitted_by sexual contact. The infection has_symptom sores, has_symptom fever, and has_symptom swollen glands." ;
    :has_exact_synonym "Genital herpes simplex"@en,
        "Herpes Genitalis"@en,
        "Virus-Genital Herpes"@en,
        "venereal herpes"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neurofibromatosis rdfs:subClassOf [ a owl:Restriction ;
