    :has_exact_synonym "Decubitus (pressure) ulcer"@en,
        "Decubitus ulcer any site"@en,
        "pressure sores"@en,
        "pressure ulcer"@en ;
    :has_related_synonym "bedsore"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:in_situ_carcinoma rdfs:subClassOf :pre_malignant_neoplasm ;
    :has_definition "A carcinoma that is an early development defined by the absence of invasion of surrounding tissues." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vascular_dementia rdfs:subClassOf :dementia ;
    :has_definition "A dementia that involves impairments in cognitive function caused by problems in blood vessels that feed the brain." ;
    :has_exact_synonym "Multi Infarct Dementia"@en,
        "multifocal dementia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:milker_s_nodule rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :contact_transmission ;
                            rdf:rest [ rdf:first :vehicle_borne_fomite_transmission ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lymphadenopathy ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :pseudocowpox_virus ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lymphangitis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :enlargement_of_lymph_nodes ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in infection of cattle and humans, located_in skin, has_material_basis_in Pseudocowpox virus, which is transmitted_by contact with the infected cow teats, or transmitted_by fomites. The infection results_in_formation_of lesions on the fingers, hands, and forearms and has_symptom fever, has_symptom lymphangitis, and has_symptom lymphadenopathy." ;
    :has_exact_synonym "Milkers' node"@en,
        "Paravaccinia"@en,
        "milker nodule"@en ;
    :has_related_synonym "Pseudocowpox"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

