            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abscess ],
        :aspiration_pneumonia ;
    :has_definition "An aspiration pneumonia caused by anaerobic bacteria like Bacteroides fragilis, Peptostreptococcus, anaerobic streptococci, Fusobacterium species (Fusobacterium nucleatum and Fusobacterium necrophoram). Lung abscess and empyema are diagnosed in this disease." ;
    :has_exact_synonym "pneumonia due to anaerobes"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:carotid_body_cancer rdfs:subClassOf :vascular_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :carotid_body ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A vascular cancer that is characterized by an encapsulated, firm round mass at the bifurcation of the common carotid artery." ;
    :has_exact_synonym "malignant Carotid body Paraganglioma"@en,
        "malignant carotid body tumor"@en ;
    :has_related_synonym "cancer of carotid body"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:smallpox rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :zone_of_skin ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :variola_virus ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :contact_transmission ;
