        :skin_disease,
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results in infection located in skin, has_material_basis_in Variola virus, which is transmitted by droplets from oral, nasal or pharyngeal mucosa, transmitted by contact with the body fluids, or transmitted by fomites. The infection results in formation of lesions, first on the face, hands and forearms and later on the trunk." ;
    :has_exact_synonym "Ordinary smallpox"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:leukoplakia_of_penis rdfs:subClassOf :penile_disease ;
    :has_exact_synonym "Kraurosis of penis"@en,
        "Penile Leukoplakia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bacterial_pneumonia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :pneumonia ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :bacteria ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        :bacterial_infectious_disease,
        :pneumonia ;
    :has_definition "A pneumonia involving inflammation of the lungs caused by bacteria." ;
    :has_exact_synonym "Pneumonia due to other gram-negative bacteria"@en,
        "gram-negative pneumonia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:seborrheic_dermatitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hair_loss ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :itching ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_lesion ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_desquamation ],
        :dermatitis ;
    :has_definition "A dermatitis that is an inflammatory skin condition resulting in flaky, white to yellowish scales on oily areas such as the scalp or inside the ear, which is caused due to a combination of an over production of skin oil and irritation from a yeast Malassezia furfur. The symptoms include itching, skin lesions and scales, redness, plaques and hair loss." ;
    :has_exact_synonym "SKIN SEBORRHEIC"@en,
        "Seborrhoeic dermatitis"@en,
        "Seborrhoeic eczema"@en,
        "seborrhea"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

