    :has_exact_synonym "Fifth disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pyomyositis rdfs:subClassOf :myositis ;
    :has_exact_synonym "Tropical pyomyositis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_megakaryocytic_leukemia rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia that derives from blood-forming tissue in which megakaryocytes proliferate in the bone marrow and circulate in the blood in large numbers." ;
    :has_exact_synonym "Megakaryocytic myelosis"@en,
        "Thrombocytic leukaemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:contagious_pustular_dermatitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :zone_of_skin ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :orf_virus ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :contact_transmission ;
                            rdf:rest [ rdf:first :vehicle_borne_fomite_transmission ;
                                    rdf:rest :nil ] ] ] ],
        :skin_disease,
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in infection located_in skin, has_material_basis_in Orf virus, which is transmitted_by contact with infected or recently vaccinated animals, or transmitted_by fomites carrying the virus. The infection has_symptom lesions on the finger, hand, arm, face, and penis." ;
    :has_exact_synonym "Ecthyma contagiosum"@en,
        "Ecthyma, Contagious"@en,
