                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :breast ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An in situ carcinoma that is located_in the breast." ;
    :has_exact_match "MESH:D000071960" ;
    :has_exact_synonym "Non-Infiltrating carcinoma of breast"@en,
        "carcinoma in situ of breast"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

