:lung_carcinoma_in_situ rdfs:subClassOf :in_situ_carcinoma ;
    :has_definition "An in situ carcinoma that is located_in the lung." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
