                            rdf:rest :nil ] ] ] ;
    :has_definition "An in situ carcinoma that is located_in the trachea." ;
    :has_exact_synonym "Tracheal carcinoma In situ"@en,
        "carcinoma in situ of trachea"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:heterophyiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :brain ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :heart ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        :brain_disease,
        :heart_disease,
        :parasitic_helminthiasis_infectious_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves intestinal infection by the parasite of the genus Heterophyes. The symptoms are diarrhea and colicky abdominal pain. Migration of the eggs to the heart, results in fatal myocardial and valvular damage. Brain can also be infected." ;
    :has_exact_synonym "heterophyes infectious disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:colon_carcinoma_in_situ rdfs:subClassOf :colonic_disease,
        :intestine_carcinoma_in_situ ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :in_situ_carcinoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :colon ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An intestine carcinoma in situ that is located_in the colon." ;
    :has_exact_synonym "carcinoma in situ of colon"@en,
        "stage 0 Colonic carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

