    :has_exact_synonym "helminth infection"@en,
        "helminthiasis"@en,
        "helminthosis"@en,
        "worm infection"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hodgkin_s_lymphoma_nodular_sclerosis rdfs:subClassOf :hodgkin_s_lymphoma ;
    :has_exact_synonym "Classical Hodgkin lymphoma, nodular sclerosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

