                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :sublingual_gland ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A salivary gland cancer that is located_in the sublingual gland." ;
    :has_exact_synonym "malignant tumor of sublingual gland"@en,
        "malignant tumor of the Sublingual gland"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fascioliasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :bile_duct ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :left_upper_quadrant_abdominal_rigidity ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :fasciola ],
        :bile_duct_disease,
        :parasitic_helminthiasis_infectious_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves parasitic infection of the bile ducts of the liver by Fasciola hepatica or Fasciola gigantica. During the acute phase, manifestations include abdominal pain, hepatomegaly, fever, vomiting, diarrhea, urticaria and eosinophilia. Occasionally, infection occurs in intestinal wall, lungs, subcutaneous tissue, and pharyngeal mucosa." ;
    :has_exact_synonym "Fasciola hepatica infection"@en,
        "Infection by Fasciola"@en,
        "Liver flukes"@en,
        "Sheep liver fluke infection"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

