        "acute monocytic leukaemia"@en,
        "acute monocytic leukaemia without mention of remission"@en,
        "acute monocytic leukemia without mention of remission"@en,
        "acute monocytic leukemia, FAB M5"@en,
        "acute monocytic leukemia, morphology"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:actinic_keratosis rdfs:subClassOf :pre_malignant_neoplasm ;
