        "Senile hyperkeratosis"@en,
        "Solar keratosis"@en,
        "actinic (Solar) Keratosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:molluscum_contagiosum rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :contact_transmission ;
                            rdf:rest [ rdf:first :vehicle_borne_fomite_transmission ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :molluscum_contagiosum_virus ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_lesion ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in infection located_in skin, has_material_basis_in Molluscum contagiosum virus, which is transmitted_by contact with the skin, and transmitted_by fomites. The infection has_symptom lesions which are flesh-colored with a pit in the center." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neuromyelitis_optica rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :spinal_cord ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cranial_nerve_ii ],
        :autoimmune_disease_of_central_nervous_system,
        :autoimmune_disease_of_peripheral_nervous_system,
        :optic_nerve_disease,
        :spinal_cord_disease ;
    :has_definition "A central nervous system disease characterized by inflammation of the optic nerve (optic neuritis) and inflammation of the spinal cord (myelitis)." ;
    :has_exact_synonym "Devic's disease"@en,
        "Devic's syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:penis_carcinoma_in_situ rdfs:subClassOf :in_situ_carcinoma,
        :penile_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :in_situ_carcinoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :penis ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An in situ carcinoma that is located_in the penis." ;
    :has_exact_synonym "Bowen's disease of penis"@en,
        "Penile intraepithelial neoplasia grade III"@en,
        "Queyrat's erythroplasia"@en,
        "carcinoma in situ of penis"@en,
        "grade III squamous Intraepithelial Lesion of penis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fasciolopsiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anasarca ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :intestinal_obstruction ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :ascites ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        :parasitic_helminthiasis_infectious_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves parasitic infection of the intestine by Fasciolopsis buski. The symptoms include diarrhea, abdominal pain, fever, ascites, anasarca and intestinal obstruction." ;
    :has_exact_synonym "Infection by Fasciolopsis buski"@en,
        "Infectious Disease by Fasciolopsis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rosacea rdfs:subClassOf :skin_disease ;
    :has_exact_synonym "Acne roscea"@en,
        "Acne, erythematosa"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lower_lip_cancer rdfs:subClassOf :lip_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :lower_lip ] ;
                            rdf:rest :nil ] ] ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chorioretinitis rdfs:subClassOf :eye_disease ;
    :has_exact_synonym "retinochoroiditis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pityriasis_rosea rdfs:subClassOf :dermatitis ;
    :has_definition "A dermatitis that is characterized by an initial large round spot on the chest, abdomen, or back, often referred to as a herald patch, that is usually followed within a week by a distinctive pattern of similar but smaller papules on the torso, arms, and legs." ;
    :has_exact_synonym "Pityriasis circinata"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

