            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_immunoglobulin_level ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :zone_of_skin ;
                            rdf:rest [ rdf:first :connective_tissue ;
                                    rdf:rest :nil ] ] ] ],
        :autoimmune_disease_of_skin_and_connective_tissue ;
    :has_definition "A skin disease that is characterized by patches of thick red skin and silvery scales." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:progressive_myoclonus_epilepsy rdfs:subClassOf :variable_age_at_onset_electroclinical_syndrome ;
    :has_definition "A variable age at onset electroclinical syndrome characterized by a relentlessly progressive disease course until death." ;
    :has_exact_match "NCI:C7636" ;
    :has_exact_synonym "PME"@en,
        "progressive myoclonic epilepsy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tinea_nigra rdfs:subClassOf :superficial_mycosis ;
    :has_definition "A superficial mycosis that is a superficial fungal infection of the skin characterized by brown to black macules which usually occur on the palmar aspects of hands and occasionally the plantar and other surfaces of the skin, caused by Hortaea werneckii, which is a common saprophytic fungus believed to occur in soil, compost, humus and on wood in humid tropical and sub-tropical regions." ;
    :has_exact_synonym "Infection by Cladosporium werneckii"@en,
        "Keratomycosis nigricans"@en,
        "Tinea palmaris nigra"@en ;
    :has_related_synonym "microsporosis nigra"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dermatophytosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :ascomycota ],
        :cutaneous_mycosis ;
    :has_definition "A cutaneous mycosis that results_in fungal infection located_in scalp, located_in glabrous skin, or located_in nail, has_material_basis_in Ascomycota fungi that belong to a group called dermatophytes, which have the ability to utilize keratin as a nutrient source." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:leukoplakia_of_vagina rdfs:subClassOf :vaginal_disease ;
    :has_definition "A vaginal disease that is a precancerous lesion that is characterized by the presence of white plaques which cannot be rubbed off. Histology shows increased keratin." ;
    :has_exact_synonym "vaginal Leukoplakia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:skin_melanoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :zone_of_skin ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :melanocyte ],
        :melanoma,
        :skin_cancer ;
    :has_definition "A skin cancer that has_material_basis_in melanocytes." ;
    :has_exact_synonym "cutaneous melanoma"@en,
        "malignant ear melanoma"@en,
        "malignant lip melanoma"@en,
        "malignant lower limb melanoma"@en,
        "malignant melanoma of ear and/or external auricular canal"@en,
        "malignant melanoma of skin of lower limb"@en,
        "malignant melanoma of skin of trunk except scrotum"@en,
        "malignant melanoma of skin of upper limb"@en,
        "malignant neck melanoma"@en,
        "malignant scalp melanoma"@en,
        "malignant trunk melanoma"@en,
        "malignant upper limb melanoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autoimmune_thrombocytopenic_purpura rdfs:subClassOf :primary_thrombocytopenia ;
    :has_definition "A primary thrombocytopenia that involves relatively few platelets in blood as a result of autoantibodies." ;
    :has_exact_synonym "Immune thrombocytopenic purpura"@en,
        "idiopathic thrombocytopenic purpura"@en,
        "primary thrombocytopenic purpura"@en ;
    :has_related_synonym "Ideopath thrombocytopenic pur"@en,
        "Idiopathic purpura"@en,
        "werlhof's disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:learning_disability rdfs:subClassOf :specific_developmental_disorder ;
    :has_definition "A specific developmental disorder that involves difficulty in scholastic skills such as reading, writing, spelling, reasoning, recalling and/or organizing information resulting from the brain's inability to receive and process information." ;
    :has_exact_synonym "Academic skill disorder"@en,
        "learning disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atrophic_gastritis rdfs:subClassOf :gastritis ;
    :has_exact_synonym "gastric atrophy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

