            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :brain ;
                            rdf:rest [ rdf:first :cornea ;
                                    rdf:rest [ rdf:first :liver ;
                                            rdf:rest :nil ] ] ] ] ],
        :metal_metabolism_disorder ;
    :has_definition "A metal metabolism disease that is characterized by excess copper stored in various body tissues, particularly the liver, brain, and corneas of the eyes." ;
    :has_exact_synonym "Cerebral pseudosclerosis"@en,
        "Westphal pseudosclerosis"@en,
        "Westphal-Strumpell syndrome"@en,
        "Wilson's disease"@en,
