            owl:onProperty :has_symptom ;
            owl:someValuesFrom :contracture ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hand_weakness ],
        :connective_tissue_disease ;
    :has_definition "A connective tissue disease characterized by progressive fibrosis and thickening located_in the palmar fascia and has_symptom early painless nodules, has_symptom decreased range of motion, has_symptom weakened grip, and has_symptom eventual contracture." ;
    :has_exact_synonym "Dupuytren's contracture of foot"@en,
        "Ledderhose's disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:waldeyer_s_ring_cancer rdfs:subClassOf :lymphatic_system_cancer,
        :oropharynx_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :tonsillar_ring ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Waldeyer ring cancer"@en,
        "malignant neoplasm of Waldeyer's ring"@en,
        "malignant tumor of Waldeyer's ring"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:seborrheic_infantile_dermatitis rdfs:subClassOf :seborrheic_dermatitis ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :seborrheic_dermatitis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :scalp ] ;
                            rdf:rest :nil ] ] ] ;
