    :has_exact_synonym "Complement 5 dysfunction"@en,
        "Generalized seborrheic dermatitis of infants"@en,
        "Infantile seborrheic dermatitis"@en,
        "Infantile seborrhoeic dermatitis"@en,
        "Pityriasis capitis"@en,
        "Seborrhea sicca"@en,
        "Seborrhoea capitis"@en,
        "Seborrhoeic dermatitis of scalp"@en,
        "Seborrhoeic eczema of scalp"@en,
        "cradle cap"@en,
        "seborrhea capitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lattice_corneal_dystrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :epithelial_stromal_tgfbi_dystrophy ;
    :has_definition "An epithelial-stromal TGFBI dystrophy that is characterized by recurrent erosions and lattice line refractile and fleck-like opacification located_in the cornea, amyloid deposits beginning in the anterior stroma, and progressive vision loss later in life, and has_material_basis_in autosomal dominant inheritance of mutation of transforming growth factor beta-induced gene located in chromosome 5q31.1, which encodes keratoepithelin. Abnormalities lead to increased amyloid protein deposition and disruption of the corneal surface." ;
    :has_exact_synonym "familial amyloid neuropathy, Finnish type"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:severe_nonproliferative_diabetic_retinopathy rdfs:subClassOf :diabetic_retinopathy ;
    :has_exact_synonym "High risk non proliferative diabetic retinopathy"@en,
        "Severe NPDR"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diabetic_retinopathy rdfs:subClassOf :retinal_vascular_disease ;
    :has_exact_synonym "Retinal abnormality - diabetes-related"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sideroblastic_anemia rdfs:subClassOf :aplastic_anemia ;
    :has_definition "An aplastic anemia where the bone marrow produces ringed sideroblasts rather than healthy red blood cells (erythrocytes)." ;
    :has_exact_synonym "ANEMIA SIDEROBLASTIC"@en,
        "Anemia, hypochromic with iron loading"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cowpox rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :cowpox_virus ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in infection in rodents, cows, and humans, located_in skin, has_material_basis_in Cowpox virus, which is transmitted_by contact with an infected animal. The infection results_in_formation_of vesicopustular lesions on the hands or face." ;
    :has_exact_synonym "yaba"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:metal_metabolism_disorder rdfs:subClassOf :inherited_metabolic_disorder ;
    :has_definition "An inherited metabolic disorder that involves metabolic disturbances in the processing or distribution of dietary minerals." ;
    :has_exact_synonym "inborn metal metabolism disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tonsillar_fossa_cancer rdfs:subClassOf :oropharynx_cancer ;
    :has_exact_synonym "malignant neoplasm of tonsillar fossa"@en,
        "malignant tumor of tonsillar fossa"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:subacute_sclerosing_panencephalitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :measles_morbillivirus ],
        :viral_infectious_disease ;
