    :has_exact_synonym "Immunosuppressive measles encephalitis"@en,
        "Van Bogaert's sclerosing leukoencephalitis"@en,
        "subacute sclerosing leukoencephalopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_polycystic_kidney_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :polycystic_kidney_disease ;
    :has_definition "A polycystic kidney disease characterized by the presence of multiple cysts located_in the kidney resulting from ciliopathy that disrupts the function of primary cilium, inherited in an autosomal dominant fashion." ;
    :has_exact_synonym "ADPKD",
        "Congenital biliary ectasias"@en,
        "POLYCYSTIC KIDNEY AND HEPATIC DISEASE 1"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:narcolepsy rdfs:subClassOf :sleep_disorder ;
    :has_definition "A sleep disorder that involves an excessive urge to sleep at inappropriate times, such as while at work." ;
    :has_exact_synonym "Narcolepsy, without cataplexy"@en,
        "paroxysmal sleep"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:choledochal_cyst rdfs:subClassOf :bile_duct_disease ;
    :has_definition "A bile duct disease characterized by cystic dilation of one or more extrahepatic or intrahepatic bile ducts." ;
    :has_exact_synonym "bile duct cyst",
        "biliary cyst",
        "Congenital choledochal cyst"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

