        :uterus_carcinoma_in_situ ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :in_situ_carcinoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :uterine_cervix ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An uterus carcinoma in situ that is located_in the uterine cervix." ;
    :has_exact_synonym "CIN III"@en,
        "CIN III - carcinoma in situ of cervix"@en,
        "CIN III - severe dyskaryosis"@en,
        "Cervix Ca in situ"@en,
        "Severe Dysplasia of the Cervix Uteri"@en,
        "Severe dysplasia of cervix"@en,
        "carcinoma in situ of cervix"@en,
        "carcinoma in situ of uterine cervix"@en,
        "carcinoma of cervix stage 0"@en,
        "cervical intraepithelial neoplasia grade III with severe dysplasia"@en,
        "squamous intraepithelial neoplasia, grade III"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polycythemia_vera rdfs:subClassOf :myeloproliferative_neoplasm ;
    :has_definition "A myeloproliferative neoplasm characterized by erythroid hyperplasia, myeloid leukocytosis, thrombocytosis, and splenomegaly." ;
    :has_exact_synonym "chronic erythremia",
        "Osler-Vaquez syndrome"@en,
        "Polycythaemia rubra vera"@en,
        "Proliferative polycythaemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:degenerative_disc_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :intervertebral_disk ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dehydration ],
        :bone_deterioration_disease ;
