    :has_exact_synonym "cervical disc degenerative disease"@en,
        "intervertebral disc degeneration"@en,
        "lumbar disc degeneration"@en,
        "vertebral disc disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

