    :has_definition "A syndrome that is characterized by the sudden death of an infant that is not predicted by medical history and remains unexplained after a thorough forensic autopsy and detailed death scene investigation." ;
    :has_exact_synonym "Cot death"@en,
        "Crib death"@en,
        "SIDS"@en,
        "Sudden death of nonspecific cause in infancy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

