            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :zone_of_skin ;
                            rdf:rest [ rdf:first :connective_tissue ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_immunoglobulin_level ],
        :arthritis,
        :autoimmune_disease_of_skin_and_connective_tissue ;
