    :has_definition "A superficial mycosis that is a chronic, superficial fungal infection of the skin caused by Malassezia furfur, which is characterized by well-demarcated white, pink, fawn, or brownish lesions, often coalescing, and covered with thin furfuraceous scales." ;
    :has_exact_synonym "Infection by Pityrosporum furfur"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ritter_s_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :necrosis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_peeling ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :rash ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :irritability ],
        :commensal_bacterial_infectious_disease,
        :skin_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :commensal_bacterial_infectious_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :zone_of_skin ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A commensal bacterial infectious disease that is characterized by widespread erythema, peeling, and necrosis of the skin, that is caused by a toxin produced by a bacterium of the genus Staphylococcus (S. aureus). The infection has_symptom redness of skin, has_symptom fluid-filled blister formation, has_symptom fever and has_symptom irritability." ;
    :has_exact_synonym "Dermatitis exfoliativa neonatorum"@en,
        "Pemphigus neonatorum"@en,
        "Ritter disease"@en,
        "Scalded skin syndrome"@en,
        "Staphylococcal scalded skin syndrome"@en,
        "Toxic epidermal necrolysis, subcorneal type"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
