                                    owl:someValuesFrom :leishmania_genus_ ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A parasitic protozoa infectious disease that involves infection caused by protozoan parasite of the genus Leishmania, which is transmitted by the bite of sand fly (subfamily Phlebotominae)." ;
    :has_related_synonym "Post Kala-Azar Dermal Leishmaniasis"@en,
        "Post-kala-azar dermal leishmaniasis"@en,
        "post-kala-azar dermal infectious disease by leishmaniasis"@en .

