        "cottonpox"@en,
        "milkpox"@en,
        "whitepox"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mucocutaneous_leishmaniasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :upper_respiratory_tract ],
        :leishmaniasis,
        :upper_respiratory_tract_disease ;
    :has_definition "A leishmaniasis that involves a chronic inflammatory process involving the nasal, pharyngeal, and laryngeal mucosa, which can lead to extensive tissue destruction, caused by protozoan parasites belonging to the genus Leishmania. The infection is characterized by granulomatous lesion which can destroy upper respiratory tract mucosa." ;
    :has_exact_synonym "American cutaneous leishmaniasis"@en,
        "American mucocutaneous leishmaniasis"@en,
        "Cutaneous leishmaniasis, American"@en,
        "Mucocutaneous leishmaniasis, American"@en,
        "New World cutaneous leishmaniasis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gas_gangrene rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :gangrene ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :blister ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :necrosis ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :clostridium_perfringens ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :bacterial_sepsis ],
        :commensal_bacterial_infectious_disease,
        :muscular_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :commensal_bacterial_infectious_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :muscle_tissue ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A commensal bacterial infectious disease that results in infection, located in muscle tissue, has_material_basis_in Clostridium perfringens, which produce gas that becomes trapped in the infected tissue. Gas gangrene usually develops after injuries or surgery. The infection has symptom large blisters, has symptom pain in the infected area, has symptom myonecrosis, has symptom gas production, and has symptom sepsis." ;
    :has_exact_synonym "Gas bacillus infection"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:liver_benign_neoplasm rdfs:subClassOf :endocrine_organ_benign_neoplasm,
        :hepatobiliary_benign_neoplasm,
        :liver_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :benign_neoplasm ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :liver ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "epithelial hepatic and intrahepatic bile duct neoplasm"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:achalasia rdfs:subClassOf :esophageal_disease ;
    :has_definition "An esophageal disease that is characterized by an inability of the esophagus to move food toward the stomach resulting from the lower esophogeal sphincter not fully relaxing during swallowing." ;
    :has_exact_synonym "Lack of reflex relaxation of lower oesophageal sphincter"@en,
        "achalasia of cardia"@en,
        "achalasia of esophagus"@en,
        "cardiospasm"@en,
        "esophageal achalasia"@en,
        "hypertensive lower esophageal sphincter"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neurotic_excoriation rdfs:subClassOf :dermatitis ;
    :has_exact_synonym "Dermatitis artefacta"@en,
        "Dermatitis factitia"@en,
        "Dermatitis ficta"@en,
        "Factitious skin disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:wiskott_aldrich_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :syndrome,
        :x_linked_recessive_disease ;
    :has_definition "A syndrome that is characterized by abnormal immune system function and a reduced ability to form blood clots resulting from a decrease in the number and size of blood cell fragments involved in clotting (microthrombocytopenia)." ;
    :has_exact_synonym "Wiskott syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:liver_leiomyoma rdfs:subClassOf :liver_benign_neoplasm ;
    :has_exact_synonym "leiomyoma of the Liver"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:submandibular_gland_cancer rdfs:subClassOf :salivary_gland_cancer,
        :submandibular_gland_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :submandibular_gland ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "malignant neoplasm of submaxillary gland"@en,
        "malignant tumor of submandibular gland"@en,
        "malignant tumor of the Submandibular gland"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rectum_carcinoma_in_situ rdfs:subClassOf :in_situ_carcinoma ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :in_situ_carcinoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :rectum ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An in situ carcinoma that is located_in the rectum." ;
    :has_exact_synonym "Severe Rectal Dysplasia"@en,
        "Severe dysplasia of rectum"@en,
        "carcinoma in situ of rectum"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:liver_inflammatory_pseudotumor rdfs:subClassOf :liver_disease ;
    :has_exact_synonym "Inflammatory Pseudotumor of the Liver"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amebiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :entamoeba_histolytica ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        :parasitic_protozoa_infectious_disease ;
    :has_definition "A parasitic protozoa infectious disease that involves infection caused by the amoeba Entamoeba histolytica. Amebic invasion of the intestinal lining causes dysentery, colitis or diarrhea. The infection can also spread through the blood to the liver and, rarely, to the lungs, brain or other organs." ;
    :has_exact_match "MESH:D000562" ;
    :has_exact_synonym "amoebiasis"@en,
        "entamoebiasis"@en ;
    :has_related_synonym "chronic intestinal amebiasis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pemphigus rdfs:subClassOf [ owl:intersectionOf [ rdf:first :dermatitis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_symptom ;
                                    owl:someValuesFrom :blister ] ;
                            rdf:rest :nil ] ] ],
        :autoimmune_disease_of_skin_and_connective_tissue,
        :bullous_skin_disease ;
    :has_definition "An autoimmune disease of skin and connective tissue that is characterized by blistering of the outer layer of the skin and mucous membranes (mouth, nose, throat, eyes, and genitals), causing lesions and blisters that are easily ruptured." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vestibule_of_mouth_cancer rdfs:subClassOf :oral_cavity_cancer ;
    :has_exact_synonym "malignant neoplasm of vestibule of mouth"@en,
        "malignant tumor of vestibule of mouth"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:speech_disorder rdfs:subClassOf :communication_disorder ;
    :has_definition "A communication disorder that involves difficulty with the act of speech production." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lichen_planus rdfs:subClassOf :lichen_disease ;
    :has_definition "A lichen disease that is located_in skin, located_in tongue or located_in oral mucosa, which presents itself in the form of papules, lesions or rashes." ;
    :has_exact_match "MESH:D008010" ;
    :has_exact_synonym "Lichen, ruber planus"@en,
        "lichen ruber planus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:barrett_s_esophagus rdfs:subClassOf :esophageal_disease ;
    :has_definition "An esophageal disease characterized by a change of normal esophageal squamous epithelium to a columnar and intestinal-type epithelium." ;
    :has_exact_synonym "Barrett esophagus"@en,
        "Barrett's esophagus with esophagitis"@en,
        "Barrett's oesophagus"@en,
        "Barrett's ulcer of esophagus"@en,
        "Barretts syndrome"@en,
        "ulcerative esophagitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:periodic_limb_movement_disorder rdfs:subClassOf :sleep_disorder ;
    :has_definition "A sleep disorder that involves involuntary limb movement during sleep." ;
    :has_exact_synonym "nocturnal myoclonus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:herpes_zoster_oticus rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :tinnitus ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vertigo ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :paralysis ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :facial_nerve ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :human_alphaherpesvirus_3 ],
        :facial_nerve_disease,
        :poliomyelitis ;
    :has_definition "A viral infectious disease that results_in inflammation located_in facial nerve, which leads to paralysis of one side of the face, has_material_basis_in Human herpesvirus 3, which reactivates after appearing as chickenpox in childhood. The infection has_symptom vesicular rash of the ear or mouth, has_symptom tinnitus, has_symptom vertigo, has_symptom otalgia, and has_symptom headache." ;
    :has_exact_synonym "Geniculate herpes zoster"@en,
        "Herpes zoster auricularis"@en,
        "Herpetic geniculate ganglionitis"@en,
        "Ramsay Hunt syndrome type 2"@en,
        "Ramsay Hunt syndrome type II"@en,
        "Ramsey Hunt syndrome"@en,
        "geniculate neuralgia"@en,
        "nervus intermedius neuralgia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pityriasis_rubra_pilaris rdfs:subClassOf :skin_disease ;
    :has_definition "A skin disease that is characterized by hyperkeratotic follicular papules coalescing into orange-red scaly plaques, islands of sparing, and palmoplantar keratoderma." ;
    :has_exact_synonym "Devergie's disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_sleep_apnea rdfs:subClassOf :sleep_apnea ;
    :has_definition "A sleep apnea that is characterized by a malfunction of the basic neurological controls for breathing rate and the failure to give the signal to inhale, causing the individual to miss one or more cycles of breathing." ;
    :has_exact_synonym "primary central sleep apnea"@en ;
    :has_related_synonym "central sleep apnea syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pompholyx rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_desquamation ],
        :sweat_gland_disease ;
    :has_definition "A sweat gland disease that is characterized by recurrent vesicles and bullae that develop particularly upon the lateral palms, soles, and fingers and has_symptom pruritis and cracked skin." ;
    :has_exact_synonym "Cheiropompholyx"@en,
        "DYSHYDROTIC ECZEMA"@en,
        "Vesicular eczema of hands and/or feet"@en,
        "dyshidrosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kidney_carcinoma_in_situ rdfs:subClassOf :in_situ_carcinoma,
        :kidney_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :in_situ_carcinoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :kidney ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An in situ carcinoma that is located_in the kidney." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pyriform_sinus_cancer rdfs:subClassOf :hypopharynx_cancer ;
    :has_exact_synonym "malignant neoplasm of pyriform fossa"@en,
        "malignant neoplasm of the Pyriform Fossa"@en,
        "malignant tumor of pyriform fossa"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:erythromelalgia rdfs:subClassOf :neuropathy ;
    :has_definition "A neuropathy that is characterized by intense, burning pain of affected extremities, severe redness and increased skin temperature." ;
    :has_exact_synonym "erythermalgia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alagille_syndrome rdfs:subClassOf :liver_disease ;
    :has_definition "A liver disease that is characterized by an accumulation of bile in the liver resulting from a reducted number of liver small bile ducts." ;
    :has_exact_match "MESH:D016738" ;
    :has_exact_synonym "Alagille-Watson syndrome"@en,
        "Arteriohepatic dysplasia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebral_amyloid_angiopathy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hemorrhage ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cerebrum ],
        :amyloidosis,
        :inherited_metabolic_disorder ;
    :has_definition "An amyloidosis where amyloid protein progressively deposits in cerebral blood vessel walls with subsequent degenerative vascular changes that usually result in spontaneous cerebral hemorrhage, ischemic lesions and progressive dementia." ;
    :has_exact_synonym "Cerebral Hemorrhage, Hereditary, with Amyloidosis"@en,
        "Hereditary Cerebral Hemorrhage with Amyloidosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pallister_hall_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by hypothalamic hamartoma, pituitary dysfunction, central polydactyly, and visceral malformations and has_material_basis_in autosomal dominant heterozygous mutation in the GLI3 gene on chromosome 7p14." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:beemer_langer_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :hydrops_fetalis ],
        :syndrome ;
    :has_definition "A syndrome that results_in multiple congenital anomalies, including hydrops fetalis, facial and visceral abnormalities, short ribs, and short limbs without polydactyly." ;
    :has_exact_synonym "type IV short rib polydactyly syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acrocallosal_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :agenesis_of_corpus_callosum ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :polygenic_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :digenic_inheritance ],
        :digenic_disease,
        :syndrome ;
    :has_definition "A syndrome that is an autosomal recessive disorder, which is characterized by corpus callosum agenesis, polydactyly, multiple dysmorphic features, motor and mental retardation." ;
    :has_exact_match "MESH:D055673" ;
    :has_exact_synonym "ACLS"@en,
        "SCHINZEL ACROCALLOSAL SYNDROME"@en,
        "Schinzel syndrome 1"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amino_acid_metabolic_disorder rdfs:subClassOf :inherited_metabolic_disorder ;
    :has_definition "An inherited metabolic disorder that is characterized by impaired synthesis and degradation of amino acids." ;
    :has_exact_synonym "inborn errors of amino acid metabolism"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mast_cell_leukemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :mast_cell ],
        :leukemia,
        :mast_cell_neoplasm ;
    :has_definition "A leukemia that results_in an overwhelming number of tissue mast cells located_in peripheral blood." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:frontotemporal_dementia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :brain ],
        :brain_disease,
        :dementia ;
    :has_definition "A dementia characterized by progressive neuronal loss predominantly involving the frontal and/or temporal lobes of the brain resulting in a gradual and progressive decline in behavior or language." ;
    :has_exact_match "MESH:D057180" ;
    :has_exact_synonym "Wilhemsen-Lynch disease"@en,
        "frontotemporal lobar degeneration"@en,
        "multiple system tauopathy with presenile dementia"@en,
        "pallidopontonigral degeneration"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:colorectal_cancer rdfs:subClassOf :large_intestine_cancer ;
    :has_definition "A large intestine cancer that is located_in the colon and/or located_in the rectum." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:waardenburg_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by varying degrees of deafness, minor defects in structures arising from the neural crest and pigmentation anomalies of the hair, the skin and/or the iris of both eyes." ;
    :has_exact_synonym "Waardenburg Shah syndrome"@en,
        "Waardenburg's syndrome"@en,
        "van der Hoeve Halbertsona Waardenburg syndrome"@en ;
    :has_narrow_synonym "Waardenburg, types I and/or II"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nasopharynx_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :epithelial_cell ],
        :carcinoma,
        :nasopharyngeal_disease,
        :pharynx_cancer,
        :respiratory_system_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :nasopharynx ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A pharynx cancer that is located in the nasopharynx, the uppermost region of the pharynx or throat, where the nasal passages and auditory tubes join the remainder of the upper respiratory tract." ;
    :has_exact_synonym "Nasopharyngeal carcinoma"@en,
        "malignant Nasopharyngeal tumor"@en,
        "malignant neoplasm of nasopharynx"@en,
        "nasopharynx cancer"@en ;
    :has_related_synonym "carcinoma of nasopharynx"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:homocystinuria rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :aminoaciduria ],
        :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that involves an accumulation of homocysteine in the serum and an increased excretion of homocysteine in the urine." ;
    :has_exact_synonym "CBS deficiency"@en,
        "cystathionine beta synthase deficiency"@en,
        "cystathionine synthase deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:histidine_metabolism_disease rdfs:subClassOf :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that involves deficiency in histidine." ;
    :has_exact_synonym "Disturbances of histidine metabolism"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cystinuria rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :ureter ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :kidney ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :urinary_bladder ],
        :amino_acid_metabolic_disorder,
        :bladder_disease,
        :kidney_disease,
        :ureteral_disease ;
    :has_definition "An amino acid metabolic disorder that involves the formation of cystine stones in the kidneys, ureter, and bladder." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:urea_cycle_disorder rdfs:subClassOf :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that involves a deficiency of one of the enzymes in the urea cycle which is responsible for removing ammonia from the blood stream." ;
    :has_exact_synonym "disorder of metabolism of ornithine, citrulline, argininosuccinic acid, arginine and ammonia"@en,
        "disorder of urea cycle metabolism"@en,
        "urea cycle defect"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glycine_encephalopathy rdfs:subClassOf :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that involves abnormally high levels of the amino acid glycine in bodily fluids and tissues." ;
    :has_exact_synonym "Non-ketotic hyperglycinemia"@en,
        "nonketotic hyperglycinemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

