            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        :organic_acidemia ;
    :has_definition "An organic acidemia that is caused by a deficiency of decarboxylase leading to high concentrations of valine, leucine, isoleucine, and alloisoleucine in the blood, urine, and cerebrospinal fluid and characterized by an odor of maple syrup to the urine, vomiting, hypertonicity, severe mental retardation, seizures, and eventually death unless the condition is treated with dietary measures." ;
    :has_exact_synonym "Ketoacidaemia"@en,
        "branched chain ketoaciduria"@en ;
    :has_related_synonym "dihydrolipoamide dehydrogenase deficiency",
        "dihydrolipoamide dehydrogenase deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alkaptonuria rdfs:subClassOf :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that involves phenylalanine and tyrosine metabolism with the accumulation of homogentisic acid, a toxic tyrosine byproduct." ;
    :has_exact_match "MESH:D000474" ;
    :has_exact_synonym "Homogentisate 1,2-dioxygenase deficiency"@en,
        "alcaptonuria"@en ;
    :has_related_synonym "deficiency of homogentisicase"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

