    :has_definition "An urea cycle disorder that involves a mutated and ineffective form of the enzyme ornithine transcarbamylase." ;
    :has_exact_synonym "deficiency of citrulline phosphorylase"@en,
        "ornithine transcarbamylase deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:citrullinemia rdfs:subClassOf :urea_cycle_disorder ;
    :has_definition "An inherited urea cycle disorder that involves the accumulation of ammonia and other toxic substances in the blood." ;
    :has_exact_synonym "classic citrullinemia",
        "ASS deficiency"@en,
        "deficiency of citrulline-aspartate ligase"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hyperlysinemia rdfs:subClassOf :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that involves an abnormal increase of lysine in the blood." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tyrosinemia rdfs:subClassOf :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that involves impaired break down of the amino acid tyrosine." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hyperargininemia rdfs:subClassOf :urea_cycle_disorder ;
    :has_definition "An urea cycle disorder that involves arginase deficiency resulting in elevated levels of plasma arginine." ;
    :has_exact_synonym "Arginase deficiency"@en,
        "argininemia"@en,
        "deficiency of canavanase"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hyperhomocysteinemia rdfs:subClassOf :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that involves an abnormally large level of homocysteine in the blood." .

