    :has_exact_synonym "CPS I deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:phenylketonuria rdfs:subClassOf :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that is characterized by a mutation in the gene for the hepatic enzyme phenylalanine hydroxylase (PAH), rendering it nonfunctional." ;
    :has_exact_synonym "Folling's disease"@en,
        "PKU"@en,
