@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:borderline_glaucoma rdfs:subClassOf :glaucoma ;
    :has_definition "A glaucoma characterized by clinical features and risk factors that are associated with high likelihood to developing optic atrophy secondary to glaucoma in the future. These features may include elevated intraocular pressure, retinal nerve fiber layer abnormalities, abnormal anterior chamber angles, and/or a positive family history for glaucoma without any evidence of current optic nerve atrophy." ;
    :has_exact_synonym "Preglaucoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

