            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :penis ],
        :penile_disease,
        :peripheral_vascular_disease ;
    :has_definition "A peripheral vascular disease characterized by blood trapped in the penis that is unable to drain." ;
    :has_exact_synonym "Mentulagra"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
