@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myopathy_of_extraocular_muscle rdfs:subClassOf :myopathy ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :myopathy ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :extra_ocular_muscle ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Myopathy of extraocular muscles"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

