    :has_exact_synonym "Labium leporinum"@en,
        "cheiloschisis"@en,
        "cleft lip, unilateral, complete"@en,
        "complete unilateral cleft lip"@en,
        "hare lip"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
