                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :lip ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A mouth disease located_in the lip." ;
    :has_exact_synonym "disease of lips"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myocardium_cancer rdfs:subClassOf :heart_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :myocardium ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "malignant Myocardial tumor"@en,
        "malignant neoplasm of myocardium"@en,
        "tumor of Myocardium"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:language_disorder rdfs:subClassOf :communication_disorder ;
    :has_definition "A communication disorder that involves the processing of linguistic information." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:orbital_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :eye ],
        :bone_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :orbital_region ] ;
                            rdf:rest :nil ] ] ] ;
