    :has_exact_synonym "Neurofibroma of Heart"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:splenic_tuberculosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abscess ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :spleen ],
        :abdominal_tuberculosis,
        :splenic_disease ;
    :has_definition "An abdominal tuberculosis that results_in formation of granulomas or abscesses located_in spleen." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rectal_prolapse rdfs:subClassOf :rectal_disease ;
