        :respiratory_system_benign_neoplasm ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :benign_neoplasm ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :nasal_cavity ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A respiratory system benign neoplasm that arises from the nasal cavity." ;
    :has_exact_synonym "Benign Nasal Cavity Neoplasm",
        "neoplasm of nasal cavity"@en,
        "tumor of the nasal cavity"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

