    :has_exact_synonym "chronic ethmoid sinusitis"@en,
        "chronic ethmoidal sinusitis"@en,
        "ethmoidal sinusitis - chronic"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lymphangitis rdfs:subClassOf :lymphatic_system_disease ;
