    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :viruses ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A disease by infectious agent that results in infection, has_material_basis_in Viruses." ;
    :has_exact_synonym "Viral Infection"@en,
        "Viral disease"@en,
        "virus infection"@en .

