    :has_exact_synonym "Congestion-fibrosis syndrome"@en,
        "Taylor syndrome"@en,
        "pelvic congestion syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:carotid_artery_dissection rdfs:subClassOf :carotid_artery_disease ;
    :has_exact_synonym "Dissection of carotid artery"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diabetes_mellitus rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormality_of_the_endocrine_system ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :polyuria ],
        :glucose_metabolism_disease ;
    :has_definition "A glucose metabolism disease that is characterized by chronic hyperglycaemia with disturbances of carbohydrate, fat and protein metabolism resulting from defects in insulin secretion, insulin action, or both." ;
    :has_exact_synonym "diabetes" .

