    :has_definition "A diabetes mellitus that is characterized by high blood sugar, insulin resistance, and relative lack of insulin." ;
    :has_exact_synonym "insulin resistance",
        "NIDDM"@en,
        "non-insulin-dependent diabetes mellitus"@en,
        "type 2 diabetes"@en,
        "type II diabetes mellitus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brain_disease rdfs:subClassOf :central_nervous_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :brain ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A central nervous system disease that is located_in the brain." ;
    :has_exact_synonym "encephalopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intrinsic_asthma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hyperventilation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anxiety ],
        :chronic_asthma ;
    :has_definition "A chronic asthma that is triggered by factors not attributable to allergies." ;
    :has_exact_synonym "non-atopic asthma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:status_asthmaticus rdfs:subClassOf :acute_asthma ;
    :has_definition "An acute asthma that is characterized by an acute episode with a progressive severity that is poorly responsive to standard therapeutic measures, regardless of disease severity or phenotypic variant." ;
    :has_exact_synonym "Asthma with status asthmaticus"@en,
        "Severe asthma attack"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vesiculitis rdfs:subClassOf :male_reproductive_system_disease ;
    :has_exact_synonym "Seminal vesiculitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:orbital_plasma_cell_granuloma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :granuloma ],
        :chronic_orbital_inflammation ;
    :has_exact_synonym "Pseudotumor of orbit"@en,
        "orbital myositis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

