    :has_definition "A kyphosis that has_material_basis_in slouching which results_in stretching of spinal ligament and abnormal formation located_in vertebra." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fuchs_heterochromic_uveitis rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that is a chronic unilateral (or rarely bilateral) iridocyclitis appearing with the triad of heterochromia, predisposition to cataracts and glaucoma, and keratitic percipitates on the posterior corneal surface." ;
    :has_exact_synonym "Fuch's Heterochromic iridocyclitis"@en,
        "Fuchs uveitis syndrome"@en,
        "Fuchs' heterochromic cyclitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glaucomatocyclitic_crisis rdfs:subClassOf :iridocyclitis ;
    :has_exact_synonym "Posner-Schlossman syndrome"@en,
        "Terrien-Viel syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iridocyclitis rdfs:subClassOf :anterior_uveitis ;
    :has_exact_match "MESH:D015863" ;
    :has_exact_synonym "primary iridocyclitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gonococcal_iridocyclitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        :iridocyclitis .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:infectious_anterior_uveitis rdfs:subClassOf :iridocyclitis ;
    :has_exact_synonym "Infectious secondary iridocyclitis"@en,
        "secondary infected iridocyclitis"@en,
        "secondary iridocyclitis, infectious"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tracheitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :high_fever ],
        :tracheal_disease ;
    :has_definition "A tracheal disease which involves bacterial infection of the trachea often caused by Staphylococcus aureus and streptococci that follows a recent viral upper respiratory infection. The symptoms include barking croup cough, loud squeaking noise while breathing, scratchy feeling in the throat, high fever, and production of large amounts of pus-filled secretions." ;
    :has_exact_match "MESH:D014136" ;
    :has_exact_synonym "acute tracheitis"@en,
        "chronic tracheitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:croup rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        :respiratory_system_disease ;
    :has_definition "A respiratory system infectious disease that involves inflammation, edema, and subsequent obstruction of the larynx, trachea, and bronchi. The disease is caused by viruses, bacteria, allergies and inhaled irritants. It is marked by episodes of difficult breathing and hoarse metallic cough in infants and young children. Croup is caused by parainfluenza virus (types 1 and 2), Influenza A and B viruses, Measles virus, adenovirus, respiratory syncytial virus, Staphylococcus and Streptococcus." ;
    :has_exact_synonym "Croup syndrome"@en,
        "Laryngotracheobronchitis"@en,
        "acute Obstructive Laryngitis"@en,
        "acute laryngotracheobronchitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_laryngitis rdfs:subClassOf :laryngitis ;
    :has_definition "A laryngitis which lasts less than a few days." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epiglottitis rdfs:subClassOf :upper_respiratory_tract_disease ;
    :has_definition "An upper respiratory tract disease which involves inflammation of the epiglottis due to infection. Haemophilus influenzae type B is the most common bacterial causative agent, although some cases are attributable to Streptococcus pneumoniae or Streptococcus pyogenes. The infection can cause the epiglottis to either obstruct or completely close off the windpipe. Epiglottitis typically affects children, and is associated with fever, difficulty in swallowing, drooling, hoarseness of voice, and stridor." ;
    :has_exact_synonym "acute epiglottitis"@en,
        "acute epiglottitis and supraglottitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypopituitarism rdfs:subClassOf :pituitary_gland_disease ;
    :has_definition "A pituitary gland disease characterized by the decreased secretion of one or more of the eight hormones normally produced by the pituitary gland." ;
    :has_exact_synonym "Pituitary insufficiency"@en,
        "pituitary hormone deficiency"@en ;
    :has_related_synonym "Pituitary hypofunction"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diabetes_insipidus rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :polyuria ],
        :kidney_disease ;
    :has_definition "A kidney disease that is characterized by polydipsia and polyuria with a dilute urine having a specific gravity less than 1.010, hypernatremia, and dehydration." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

