    :has_definition "A hypopituitarism characterized by deficiency in growth hormone and at least one other pituitary hormone." ;
    :has_exact_synonym "combined pituitary hormone deficiency",
        "Simmond's disease"@en,
        "Simmonds' disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

