            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dyspnea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :tachypnea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :wheezing ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :allergic_reaction ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :airborne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chest_tightness ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :respiratory_tract ],
        :extrinsic_asthma,
        :respiratory_allergy ;
    :has_definition "An extrinsic asthma that is characterized by symptoms that are triggered by an allergic reaction caused by inhaled allergens such as dust mite allergen, pet dander, pollen and mold. The disease has_symptom coughing, has_symptom wheezing, has_symptom shortness of breath or has_symptom rapid breathing, and has_symptom chest tightness." ;
    :has_exact_synonym "extrinsic asthma with acute exacerbation"@en,
        "extrinsic asthma with status asthmaticus"@en ;
    :has_related_synonym "atopic asthma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blepharitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :eyelid_disease ;
    :has_definition "An eyelid disease that is characterized by often chronic inflammation of the eyelid, generally the part where eyelashes grow." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intracranial_hypertension rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :altered_mental_status ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :papilledema ],
        :brain_disease ;
    :has_definition "A brain disease that is characterized by high pressure inside the skull, the brain tissue and cerebrospinal fluid, has_symptom headache, has_symptom vomiting, has_symptom altered mental status, has_symptom papilledema." ;
    :has_exact_synonym "Raised intracranial pressure"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_glycosuria rdfs:subClassOf :renal_tubular_transport_disease ;
    :has_exact_synonym "renal diabetes"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cervical_mullerian_papilloma rdfs:subClassOf :cervical_benign_neoplasm ;
    :has_definition "A cervical benign neoplasm that is a polypoid lesion of the superficial cervix or vagina of young girls to adult women and is characterized by papillary stalks covered by mucinous epithelium with focal squamous metaplasia, highly cellular fibrous tissue, no atypia, and minimal mitotic activity." ;
    :has_exact_synonym "cervical Muellerian papilloma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cervix_squamous_papilloma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :epithelial_cell ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :mucosa ],
        :cervical_benign_neoplasm,
        :papilloma ;
    :has_definition "A cervical benign neoplasm that is a polypoid lesion characterized by a single papillary frond with a central fibrovascular core and mature squamous epithelium." ;
    :has_exact_synonym "squamous papilloma of the Cervix Uteri"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cholangitis rdfs:subClassOf :bile_duct_disease ;
    :has_definition "A bile duct disease that is an inflammation of the bile duct." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:steatotic_liver_disease rdfs:subClassOf :lipid_storage_disease,
        :liver_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :liver_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_phenotype ;
                                    owl:someValuesFrom :hepatic_steatosis ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A lipid storage disease characterized by the accumulation of large vacuoles of triglyceride fat in at least 5% of hepatocytes." ;
    :has_exact_synonym "SLD",
        "fatty liver disease",
        "hepatic steatosis",
        "Fatty change of liver"@en,
        "Steatosis of liver"@en,
        "alcoholic fatty liver"@en,
        "hepatic lipidosis"@en ;
    :has_narrow_synonym "cryptogenic steatotic liver disease" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lipid_storage_disease rdfs:subClassOf :lysosomal_storage_disease ;
    :has_definition "A lysosomal storage disease that involves the accumulation of harmful amounts of lipids (fats) in some of the body's cells and tissues." ;
    :has_exact_synonym "Lipoid storage diseas"@en,
        "inborn lipid storage disorder"@en,
        "lipoidosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dientamoebiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_cramp ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_appetite ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :weight_loss ],
        :parasitic_protozoa_infectious_disease ;
    :has_definition "A parasitic protozoa infectious disease that involves infection of the large intestine by a protozoan parasite Dientamoeba fragilis. The symptoms include diarrhea, stomach pain and cramping, loss of appetite and weight, nausea, and fatigue." ;
    :has_exact_synonym "intestinal trichomoniasis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:uterine_corpus_cancer rdfs:subClassOf :uterine_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :body_of_uterus ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A uterine cancer that is located_in the uterine corpus." ;
    :has_exact_synonym "corpus uteri cancer"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:exposure_keratitis rdfs:subClassOf :keratoconjunctivitis ;
    :has_exact_synonym "Exposure keratoconjunctivitis"@en,
        "lagophthalmic keratitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cholesteatoma_of_external_ear rdfs:subClassOf :cholesteatoma,
        :external_ear_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cholesteatoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :external_ear ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A cholesteatoma which involves invasion of the squamous tissue into a localized area of bony erosion of the ear canal. It may develop spontaneously or as a consequence of infection, trauma or surgery." ;
    :has_exact_synonym "external canal cholesteatoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:otitis_externa rdfs:subClassOf :external_ear_disease ;
    :has_definition "An external ear disease that involves inflammation of the outer ear and ear canal. It can be caused by active bacterial or fungal infections." ;
    :has_exact_synonym "swimmer's ear"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nail_patella_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :nail ;
                            rdf:rest [ rdf:first :patella ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by nail dysplasia and absent or hypoplastic patellae that has_material_basis_in heterozygous mutation in the LMX1B gene on chromosome 9q33.3." ;
    :has_exact_synonym "Fong disease"@en,
        "Turner-Kiser syndrome"@en,
        "hereditary onychoostedysplasia"@en,
        "iliac horn syndrome"@en,
        "nail patella syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bacterial_meningitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :bacteria ],
        :bacterial_infectious_disease,
        :meningitis ;
    :has_definition "A meningitis that has_material_basis_in a bacterial infection." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:meningitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :central_nervous_system_disease ;
    :has_definition "A central nervous system disease that is characterized by an inflammation of the pia-arachnoid meninges. It can be caused by growth of bacteria, fungi, or parasites within the subarachnoid space or by the growth of bacteria or viruses within the meningeal or ependymal cells." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mononeuritis_of_lower_limb rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :limb ],
        :mononeuritis .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sheehan_syndrome rdfs:subClassOf :hypopituitarism ;
    :has_exact_synonym "Postpartum Hypopituitarism"@en,
        "Sheehan's syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pulmonary_embolism rdfs:subClassOf :pulmonary_artery_disease ;
    :has_definition "An artery disease characterized by a blockage of the main artery of the lung or one of its branches by a substance that has travelled from elsewhere in the body, e.g. a blood clot." ;
    :has_exact_synonym "pulmonary artery embolism"@en,
        "pulmonary embolus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:postpartum_depression rdfs:subClassOf :melancholic_depression ;
    :has_definition "An endogenous depression that involves intense, sustained and sometimes disabling depression experienced by women after giving birth." ;
    :has_exact_synonym "Maternity blues"@en,
        "postnatal depression"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:meckel_s_diverticulum rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :ileum ],
        :physical_disorder ;
    :has_definition "A physical disorder that is characterized by a congenital abnormality characterized by the outpouching or sac formation in the ileum." ;
    :has_exact_synonym "Meckel Diverticulum"@en,
        "Persistent vitelline duct"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pulmonary_eosinophilia rdfs:subClassOf :hypereosinophilic_syndrome ;
    :has_definition "A hypereosinophilic syndrome characterized by the accumulation of eosinophils in the lungs." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:disseminated_eosinophilic_collagen_disease rdfs:subClassOf :collagen_disease,
        :hypereosinophilic_syndrome .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:leukocyte_disease rdfs:subClassOf :hematopoietic_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :leukocyte ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A hematopoietic system disease that is located_in white blood cells." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_eosinophilic_pneumonia rdfs:subClassOf :eosinophilic_pneumonia ;
    :has_definition "An eosinophilic pneumonia which slowly progresses over weeks to months. Life-threatening shortness of breath can develop if the condition is not treated. Individuals are often diagnosed with asthma before the advent of this disease." ;
    :has_exact_synonym "Cryptogenic pulmonary eosinophilia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:loeffler_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :allergic_reaction ],
        :allergic_disease,
        :eosinophilic_pneumonia ;
    :has_definition "An eosinophilic pneumonia described as a form of pulmonary eosinophilia characterized as a mild pneumonitis marked by transitory pulmonary infiltration and eosinophilia and usually considered to be an allergic reaction. It can occur in response to a parasitic infection." ;
    :has_exact_synonym "Loeffler's pneumonia"@en,
        "Loffler's syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:benign_mammary_dysplasia rdfs:subClassOf :breast_benign_neoplasm ;
    :has_definition "A breast benign neoplasm that encompasses a range of conditions in which there is marked change in the breast tissue." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cannabis_abuse rdfs:subClassOf :substance_abuse ;
    :has_definition "A substance abuse that involves the recurring use of cannabis despite negative consequences." ;
    :has_exact_synonym "marijuana abuse"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_ethmoiditis rdfs:subClassOf :ethmoid_sinusitis ;
    :has_definition "A ethmoid sinusitis which lasts for less than 4 weeks." ;
    :has_exact_synonym "acute ethmoid sinusitis"@en,
        "acute ethmoidal sinusitis"@en,
        "ethmoidal sinus - acute"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ethmoid_sinusitis rdfs:subClassOf :sinusitis ;
    :has_definition "A sinusitis which involves infection of ethmoid sinuses that causes pain or pressure behind and between the eyes, tearing, and headache over the forehead." ;
    :has_exact_synonym "ethmoidal sinusitis"@en,
        "ethmoiditis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plasma_cell_leukemia rdfs:subClassOf :plasma_cell_neoplasm ;
    :has_definition "A plasma cell neoplasm that is characterized by the presence of a circulating clonal plasma cell count that exceeds 2x10^9/L or is 20% of the leukocyte differential count." ;
    :has_exact_synonym "plasma cell leukaemia"@en,
        "plasmacytic leukaemia"@en,
        "plasmacytic leukemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:laron_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by marked short stature with normal or high serum growth hormone and low serum insulin-like growth factor-1 levels that has_material_basis_in homozygous or compound heterozygous mutation in GHR on chromosome 5p13-p12." ;
    :has_exact_synonym "Laron-type isolated somatotropin defect"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:latent_syphilis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        :syphilis ;
    :has_definition "A syphilis that is characterized as having serologic proof of infection without signs or symptoms of disease." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tuberculous_pneumothorax rdfs:subClassOf :pneumothorax ;
    :has_definition "A pneumothorax in which air enters into the pleural cavity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lassa_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_swelling ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :backache ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :mammarenavirus_lassaense ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bleeding ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :mastomys ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :proteinuria ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pharynx_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :conjunctivitis ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in infection, has_material_basis_in Mammarenavirus lassaense, which is transmitted_by multimammate rat of the genus Mastomys. The infection has_symptom fever, has_symptom retrosternal pain, has_symptom sore throat, has_symptom back pain, has_symptom cough, has_symptom abdominal pain, has_symptom vomiting, has_symptom diarrhea, has_symptom conjunctivitis, has_symptom facial swelling, has_symptom proteinuria (protein in the urine), and has_symptom mucosal bleeding." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_myeloma rdfs:subClassOf :leukocyte_disease,
        :myeloid_neoplasm ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :myeloid_neoplasm ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :plasma_cell ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A myeloid neoplasm that is located_in the plasma cells in bone marrow." ;
    :has_exact_synonym "myeloma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:refractory_plasma_cell_neoplasm rdfs:subClassOf :multiple_myeloma,
        :refractory_hematologic_cancer .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:indolent_plasma_cell_myeloma rdfs:subClassOf :multiple_myeloma ;
    :has_definition "A multiple myeloma that is characterized by M protein in serum and/or urine and evidence of organ damage related the plasma cell neoplasm." ;
    :has_exact_synonym "indolent myeloma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:smoldering_myeloma rdfs:subClassOf :multiple_myeloma ;
    :has_definition "A multiple myeloma that is a slow growing type of myeloma in which abnormal plasma cells results_in too much of a single type of monoclonal antibody." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adrenal_gland_disease rdfs:subClassOf :endocrine_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :adrenal_gland ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An endocrine system disease that is located_in the adrenal gland." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nasopharyngeal_disease rdfs:subClassOf :upper_respiratory_tract_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :nasopharynx ] ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_ciliary_dyskinesia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :short_stature ],
        :ciliopathy ;
    :has_definition "A ciliopathy that is characterized by impaired function of the cilia lining the respiratory tract (lower and upper, sinuses, Eustachian tube, middle ear) and fallopian tube." ;
    :has_exact_synonym "ciliary motility disorder"@en,
        "immotile ciliary syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bronchiectasis rdfs:subClassOf :bronchial_disease ;
    :has_definition "A bronchial disease that is a chronic inflammatory condition of one or more bronchi or bronchioles marked by dilatation and loss of elasticity of the walls resulting from damage to the airway wall leading to the formation of small sacs on the bronchial wall and impairment of cilia mobility in the lung. Inflammation of the bronchial wall increases mucus secretion which serves as a breeding ground for bacteria. Bronchiectasis is caused by repeated respiratory infections, immune deficiency disorders, hereditary disorders (cystic fibrosis or primary ciliary dyskinesia), mechanical factors (inhaled object or a lung tumor) or inhaling toxic substances." ;
    :has_exact_synonym "Polynesian bronchiectasis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dextrocardia rdfs:subClassOf :congenital_heart_disease ;
    :has_exact_synonym "Heart predominantly in right hemithorax"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:choanal_atresia rdfs:subClassOf :nasal_cavity_disease ;
    :has_exact_synonym "Atresia of nares"@en,
        "Imperforate nares"@en,
        "posterior choanal atresia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neonatal_candidiasis rdfs:subClassOf :candidiasis ;
    :has_definition "A candidiasis that involves fungal infection in neonates caused by Candida species. Low birthweight and age, prolonged intravascular catheterization and the use of antibiotic drugs are the principle predisposing conditions for systemic candidiasis in neonates." ;
    :has_exact_synonym "Neonatal monilia infection"@en,
        "neonatal candida infection"@en,
        "neonatal moniliasis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:venezuelan_equine_encephalitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :photophobia ],
