                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :biliary_tree ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A hepatobiliary disease that is located_in the biliary tract." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pelvic_varices rdfs:subClassOf :varicose_veins ;
    :has_definition "A varicose veins that is located_in the pelvis." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:type_1_diabetes_mellitus rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :has_phenotype ;
                            owl:someValuesFrom :abnormal_immunoglobulin_level ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :endocrine_system ] ;
                            rdf:rest :nil ] ] ],
        :autoimmune_disease_of_endocrine_system,
        :diabetes_mellitus ;
    :has_definition "A diabetes mellitus that is characterized by destruction of pancreatic beta cells resulting in absent or extremely low insulin production." ;
    :has_exact_synonym "IDDM"@en,
        "insulin-dependent diabetes mellitus"@en,
        "type I diabetes mellitus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:perianal_hematoma rdfs:subClassOf :hemorrhoid ;
    :has_exact_synonym "External thrombosed haemorrhoids"@en,
        "Thrombosed external hemorrhoids"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hemorrhoid rdfs:subClassOf :anus_disease,
        :pelvic_varices,
        :skin_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :vein_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :anus ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :disease_has_location ;
                                            owl:someValuesFrom :perianal_skin ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_definition "A pelvic varices that is characterized by swollen, inflamed veins around the anus or lower rectum." ;
    :has_exact_synonym "hemorrhoidal disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:internal_hemorrhoid rdfs:subClassOf :hemorrhoid ;
    :has_definition "A hemorrhoid that is located_in the rectum." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:emphysematous_cholecystitis rdfs:subClassOf :cholecystitis ;
    :has_definition "A cholecystitis consisting of an inflammation of the gallbladder characterized by air-filled expansions in interstitial or subcutaneous tissues, where gallbladder wall necrosis causes gas formation in the lumen or wall." ;
    :has_exact_synonym "Gaseous pericholecystitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:xanthogranulomatous_cholecystitis rdfs:subClassOf :cholecystitis ;
    :has_definition "A cholecystitis characterized by nodules containing lipid-laden macrophages." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:heart_aneurysm rdfs:subClassOf :heart_disease ;
    :has_exact_synonym "cardiac aneurysm"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:female_breast_upper_outer_quadrant_cancer rdfs:subClassOf :female_breast_cancer ;
    :has_definition "A female breast cancer that is located_in the upper-outer quadrant of the breast." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diastolic_heart_failure rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :heart_failure ],
        :congestive_heart_failure .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:irritable_bowel_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_discomfort ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloating ],
        :intestinal_disease ;
    :has_definition "An intestinal disease that is characterized by chronic abdominal pain, discomfort, bloating, and alteration of bowel habits in the absence of any detectable organic cause." ;
    :has_exact_synonym "IBD"@en,
        "Irritable colon"@en ;
    :has_related_synonym "Psychogenic IBS"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:trichinosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :trichinella ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :myocarditis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hemorrhage ],
        :parasitic_helminthiasis_infectious_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves parasitic infection of animals and humans by Trichinella spiralis, Trichinella nativa or Trichinella britovi. Intestinal invasion causes diarrhea, abdominal pain and vomiting. Larval migration into muscle tissues can cause periorbital and facial edema, conjunctivitis, fever, myalgias, splinter hemorrhages, rashes, and blood eosinophilia. Myocarditis, central nervous system involvement, and pneumonitis can also occur." ;
    :has_exact_synonym "Trichinella spiralis infection"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bulbar_polio rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dysarthria ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :breathing_problems ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :brainstem ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dysphagia ],
        :paralytic_poliomyelitis ;
    :has_definition "A paralytic poliomyelitis that results in destruction located in motor neurons of brainstem, has_material_basis_in Human poliovirus 1, has_material_basis_in Human poliovirus 2, or has_material_basis_in Human poliovirus 3, which are transmitted by ingestion of food or water contaminated with feces, or transmitted by direct contact with the oral secretions. The infection has symptom difficulty breathing, has symptom difficulty speaking, has symptom difficulty swallowing, and has symptom difficulty chewing." ;
    :has_exact_synonym "bulbar poliomyelitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myositis_fibrosa rdfs:subClassOf :myositis ;
    :has_exact_synonym "Interstitial myositis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:angioid_streaks_of_choroid rdfs:subClassOf :angioid_streaks,
        :choroidal_sclerosis,
        :retinal_degeneration ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :angioid_streaks ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :optic_choroid ] ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:toxocariasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :wheezing ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :toxocara ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :lung ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :eye ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :brain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anorexia ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :liver ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :rash ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :heart ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hepatosplenomegaly ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :muscle_tissue ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :weight_loss ],
        :brain_disease,
        :eye_disease,
        :heart_disease,
        :liver_disease,
        :lung_disease,
        :muscular_disease,
        :parasitic_helminthiasis_infectious_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves zoonotic infection of humans by the larvae of Toxocara canis or Toxocara cati. The larvae invade multiple tissues like liver, heart, lungs, brain, muscle and eyes causing various symptoms including fever, anorexia, weight loss, cough, wheezing, rashes, hepatosplenomegaly, hypereosinophilia and ophthalmologic lesions." ;
    :has_exact_synonym "Infection by Toxascaris"@en,
        "Toxocara infection"@en,
        "visceral larva migrans"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:choroidal_sclerosis rdfs:subClassOf :choroid_disease,
        :eye_degenerative_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :eye_degenerative_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :optic_choroid ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Choroidal degenerations"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tuberculous_peritonitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :emaciation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_distention ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_discomfort ],
        :gastrointestinal_tuberculosis ;
    :has_definition "A gastrointestinal tuberculosis that results_in inflammation located_in peritoneum, which results in formation of tubercles. The infection has_symptom abdominal discomfort, has_symptom pain, has_symptom distention from gas or fluid, has_symptom digestive disturbances and has_symptom emaciation." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:goodpasture_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :kidney ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :genitourinary_system ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :lung ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bleeding ],
        :autoimmune_disease_of_urogenital_tract,
        :kidney_disease,
        :lung_disease ;
    :has_definition "An autoimmune disease that is characterized by antibody attack of the basement membrane in lungs and kidneys, leading to bleeding from the lungs and kidney failure." ;
    :has_exact_synonym "anti-GBM disease"@en,
        "anti-glomerular basement membrane disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypersensitivity_vasculitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vasculitis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :blister ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :urticaria ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :purpura ],
        :hypersensitivity_reaction_type_iii_disease ;
    :has_definition "A hypersensitivity reaction type III disease that is characterized by inflammation and injury to blood vessels and has_symptom purpura, telangiectasia, blistering, urticaria, and ulcers." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polyarteritis_nodosa rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :vasculitis ;
    :has_definition "A vasculitis that is characterized by necrotizing inflammation of medium or small arteries." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_gyrate_choroidal_dystrophy rdfs:subClassOf :partial_central_choroid_dystrophy ;
    :has_exact_synonym "Choroidal dystrophy, serpiginous"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:choroideremia rdfs:subClassOf :choroid_disease ;
    :has_exact_match "MESH:D015794" ;
    :has_exact_synonym "progressive Choroidal Atrophy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:partial_central_choroid_dystrophy rdfs:subClassOf :hereditary_choroidal_atrophy ;
    :has_exact_synonym "Choroidal dystrophy, central areolar"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neonatal_abstinence_syndrome rdfs:subClassOf :withdrawal_disorder ;
    :has_definition "A withdrawal disorder that is characterized by a group of problems that occur in a newborn who was exposed to addictive illegal or prescription drugs while in the mother's womb or postnatally following the discontinuance of drug treatment." ;
    :has_exact_synonym "Drug withdrawal syndrome in newborn"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hyperopia rdfs:subClassOf :refractive_error ;
    :has_definition "A refractive error that is characterized by rays of light entering the eye parallel to the optic axis are brought to a focus behind the retina, as a result of the eyeball being too short from front to back." ;
    :has_exact_synonym "farsightedness",
        "Far-sightedness"@en,
        "hypermetropia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:esotropia rdfs:subClassOf :strabismus ;
    :has_definition "A strabismus that is characterized the eye which turns inward toward the nose." ;
    :has_exact_synonym "Convergence in manifest squint"@en,
        "Internal Strabismus"@en,
        "crossed eyes"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:total_circumpapillary_dystrophy_of_choroid rdfs:subClassOf :hereditary_choroidal_atrophy ;
    :has_exact_synonym "Circumpapillary dystrophy of choroid, total"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:peripheral_vertigo rdfs:subClassOf :vestibular_disease ;
    :has_definition "A vestibular disease that is characterized by a sensation of motion or spinning that is often described as dizziness due to a problem in the part of the inner ear that controls balance." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endolymphatic_hydrops rdfs:subClassOf :peripheral_vertigo ;
    :has_exact_synonym "labyrinthine hydrops"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:meniere_s_disease rdfs:subClassOf :endolymphatic_hydrops ;
    :has_definition "A vestibular disease characterized by vertigo, low-pitched tinnitus and hearing loss." ;
    :has_exact_synonym "Meniere disease"@en,
        "Mnire's vertigo"@en,
        "Otogenic vertigo"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lingual_facial_buccal_dyskinesia rdfs:subClassOf :movement_disease ;
    :has_exact_synonym "Oro-facial dyskinesia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_syphilis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :placental_transmission ],
        :physical_disorder,
        :syphilis ;
    :has_definition "A syphilis that results_in a multisystem infection in the fetus via the placenta." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:interstitial_keratitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :corneal_scarring ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        :connective_tissue_disease ;
    :has_definition "A connective tissue disease characterized by corneal scarring that develops from non-suppurative inflammation located_in the corneal stroma, has_symptom visual acuity loss, has_symptom pain, and has_symptom lacrimation." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alopecia_areata rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :zone_of_skin ;
                            rdf:rest [ rdf:first :connective_tissue ;
                                    rdf:rest :nil ] ] ] ],
        :autoimmune_disease_of_skin_and_connective_tissue ;
    :has_definition "An autoimmune disease resulting in the loss of hair on the scalp and elsewhere on the body initially causing bald spots." ;
    :has_exact_match "MESH:D000506" ;
    :has_exact_synonym "Circumscribed alopecia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:miliary_tuberculosis rdfs:subClassOf :extrapulmonary_tuberculosis ;
    :has_definition "An extrapulmonary tuberculosis that results in formation of tiny lesions in all the organs." ;
    :has_exact_synonym "Disseminated tuberculosis"@en,
        "Tuberculosis miliaris disseminata"@en,
        "acute miliary tuberculosis"@en,
        "generalized tuberculosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:toxic_maculopathy rdfs:subClassOf :degeneration_of_macula_and_posterior_pole ;
    :has_exact_synonym "Toxic maculopathy of retina"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

