            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :intestine ],
        :carbohydrate_metabolic_disorder,
        :intestinal_disease .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hereditary_fructose_intolerance_syndrome rdfs:subClassOf :carbohydrate_metabolic_disorder ;
    :has_definition "A carbohydrate metabolic disorder characterized by recurrent vomiting, abdominal pain, and hypoglycemia that may be fatal after introduction of fructose or sucrose to the diet that has_material_basis_in homozygous or compound heterozygous mutation in the aldolase B gene (ALDOB) on chromosome 9q31." ;
    :has_exact_synonym "Fructosaemia"@en,
        "Fructose-1,6-bisphosphate aldolase B deficiency"@en,
        "Fructosemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alopecia rdfs:subClassOf :hypotrichosis ;
    :has_definition "A hypotrichosis that is characterized by a loss of hair from the head or body." ;
    :has_exact_match "MESH:D000505" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:galactosemia rdfs:subClassOf :carbohydrate_metabolic_disorder ;
    :has_definition "A carbohydrate metabolic disorder that involves a defect in galactose metabolism resulting in toxic levels of galactose 1-phosphate in various tissues." ;
    :has_exact_synonym "Galactosaemia"@en,
        "Galactose intolerance"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

