    :has_definition "A mitral valve disease where one or both of the cusps of the mitral valve bulge or collapse backward in the left atrium during systole." ;
    :has_exact_synonym "Barlow's syndrome"@en,
        "floppy mitral valve"@en ;
    :has_related_synonym "mitral leaflet syndrome"@en,
        "myxomatous mitral valve prolapse"@en,
        "systolic click-murmur syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cardiovascular_syphilis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :vascular_dilatation ],
        :tertiary_syphilis ;
    :has_definition "A tertiary syphilis that is manifested as aneurysm formation in the ascending aorta, caused by chronic inflammatory destruction of the vasa vasorum, insufficiency of the aortic valve, or narrowing of the coronary arteries." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

