    :has_exact_synonym "Benign pseudohypertrophic muscular dystrophy"@en,
        "benign congenital myopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:muscular_dystrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :progressive_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :myopathy ;
    :has_definition "A myopathy is characterized by progressive skeletal muscle weakness degeneration." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:median_arcuate_ligament_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :median_arcuate_ligament ],
        :syndrome ;
    :has_exact_match "MESH:D000074742" ;
    :has_exact_synonym "Celiac artery compression syndrome"@en,
        "Harjola-Marable syndrome"@en,
        "Marable's syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_heart_block rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :atrioventricular_block,
        :physical_disorder ;
    :has_definition "An atrioventricular block characterized by the presence of conduction system disease of any form, which is diagnosed on or before 28 days of life." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:meibomian_cyst rdfs:subClassOf :blepharitis ;
    :has_definition "A blepharitis that is characterized as a cyst in the eyelid that is caused by inflammation of a blocked meibomian gland, usually on the upper eyelid." ;
    :has_exact_synonym "Chalazion"@en,
        "meibomian gland lipogranuloma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:follicular_mucinosis rdfs:subClassOf :sebaceous_gland_disease ;
    :has_exact_synonym "Alopecia mucinosa"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hordeolum rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :bacteria ],
        :bacterial_infectious_disease,
        :eyelid_disease ;
    :has_definition "An eyelid disease that is characterized by an infection of the sebaceous glands at the base of the eyelashes. Styes are generally caused by a Staphylococcus aureus bacterial infection." ;
    :has_exact_synonym "Hordeolum externum",
        "Boil of eyelid"@en,
        "Furuncle of eyelid"@en,
        "Stye"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_corneal_ulcer rdfs:subClassOf :corneal_ulcer ;
    :has_definition "A corneal ulcer that is characterized by ulceration and opacification of the central cornea and is caused by minor trauma and subsequent infection by bacterial or mycotic organisms." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:omsk_hemorrhagic_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hematuria ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :stiff_neck ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cervical_lymphadenopathy ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :omsk_hemorrhagic_fever_virus ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :conjunctival_suffusion ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hemoptysis ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :dermacentor ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :ixodes ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that is a hemorrhagic fever, has_material_basis_in Omsk hemorrhagic fever virus, which is transmitted_by Dermacentor and transmitted_by Ixodes species of ticks. The infection has_symptom fever, has_symptom chills, has_symptom headache, has_symptom pain in lower and upper extremities, has_symptom stiff neck, has_symptom papulovesicular rash on the soft palate, has_symptom cervical lymphadenopathy, has_symptom conjunctival suffusion, has_symptom blood in the urine, and has_symptom blood in the sputum." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_coordination_disorder rdfs:subClassOf :specific_developmental_disorder ;
    :has_definition "A specific developmental disorder that involves disordered motor skills where coordinated muscle movement is impaired." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:waterhouse_friderichsen_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :meningitis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bleeding ],
        :adrenal_gland_disease ;
    :has_definition "An adrenal gland disease that is characterized by failure of the adrenal gland due to bleeding into the gland." ;
    :has_exact_synonym "Meningococcal hemorrhagic adrenalitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_inflammation_of_lacrimal_passage rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :decreased_tearing ],
        :lacrimal_apparatus_disease ;
    :has_definition "A lacrimal apparatus disease that is characterized by longstanding inflammation of the lacrimal passage, and has_symptom pain, increased or decreased tearing, and swelling between the eye and nose." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dacryocystitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :conjunctivitis ],
        :acute_inflammation_of_lacrimal_passage ;
    :has_definition "An acute inflammation of lacrimal passage that is characterized by inflammation of the lacrimal sac, has_symptom conjunctivitis and has_symptom purulent discharge." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dacryocystocele rdfs:subClassOf :chronic_inflammation_of_lacrimal_passage ;
    :has_exact_synonym "lacrimal mucocele"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lymph_node_disease rdfs:subClassOf :lymphatic_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :lymph_node ] ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:steroid_induced_glaucoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :ocular_hypertension ],
        :glaucoma ;
    :has_definition "A glaucoma characterized by elevated intraocular pressure secondary to chronic corticosteroid use, which leads to glaucomatous optic nerve atrophy and progressive vision loss and has_symptom progressive decreased vision, visual field defects, and decreased peripheral vision. Steroid-induced glaucoma is caused by chronic corticosteroid use." ;
    :has_exact_synonym "Corticosteroid-induced glaucoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_lymphoblastic_leukemia rdfs:subClassOf :acute_leukemia ;
    :has_definition "A acute leukemia that is characterized by over production of lymphoblasts." ;
    :has_exact_synonym "ALL",
        "precursor lymphoblastic lymphoma/leukemia",
        "acute lymphoblastic leukaemia"@en,
        "acute lymphocytic leukaemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_biphenotypic_leukemia rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :has_material_basis_in ;
                            owl:someValuesFrom :t_cell ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :lymphocyte_of_b_lineage ] ;
                            rdf:rest :nil ] ] ],
        :acute_leukemia,
        :t_cell_non_hodgkin_lymphoma ;
    :has_definition "An acute leukemia that is characterized by the occurrence of more than one type of leukemia at the same time resulting from either the occurrence of blasts which coexpress myeloid and T or B lineage antigens or concurrent B and T lineage antigens." ;
    :has_exact_synonym "mixed phenotype acute leukemia" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:null_cell_leukemia rdfs:subClassOf :acute_lymphoblastic_leukemia ;
    :has_exact_synonym "Null cell acute lymphoblastic leukaemia"@en,
        "Null cell acute lymphoblastic leukemia"@en,
        "null-cell leukaemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypoplastic_left_heart_syndrome rdfs:subClassOf :congenital_heart_disease ;
    :has_definition "A congenital heart disease characterized by abnormal development of the left-sided structures of the heart." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:periostitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :connective_tissue_disease ;
    :has_definition "A connective tissue disease characterized by inflammation located_in the periosteum of the bone." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hemometra rdfs:subClassOf :uterine_disease ;
    :has_definition "A uterine disease that is characterized by the presence of blood in the uterine cavity." ;
    :has_exact_synonym "Hematometra"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:toxoplasmosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :low_white_blood_cell_count ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :placental_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anemia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cervical_lymphadenopathy ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lymphadenopathy ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :toxoplasma_gondii ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :malaise ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hepatosplenomegaly ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :vehicle_borne_ingestion_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        :coccidiosis ;
    :has_definition "A coccidiosis that has_material_basis_in protozoan Toxoplasma gondii. The parasite effects most genera of warm-blooded animals, including humans, but the primary host is the felid (cat) family. Animals are infected by eating infected meat, by ingestion of feces of a cat that has itself recently been infected, or transmission_by mother to fetus. The symptoms include bilateral, nontender cervical or axillary lymphadenopathy, fever, malaise, myalgia, hepatosplenomegaly, anemia and leukopenia." ;
    :has_exact_synonym "disseminated toxoplasmosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:carotenemia rdfs:subClassOf :acquired_metabolic_disease ;
    :has_definition "An acquired metabolic disease that is characterized by yellow-orange skin pigmentation due to high levels of carotene in blood." ;
    :has_exact_synonym "hypercarotinemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:uterine_inversion rdfs:subClassOf :uterine_disease ;
    :has_definition "A uterine disease that is characterized by the uterine cavity turning inside out as a complication of childbirth." ;
    :has_exact_match "MESH:D019687" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:obesity rdfs:subClassOf :overnutrition ;
    :has_definition "An overnutrition that is characterized by excess body fat, traditionally defined as an elevated ratio of weight to height (specifically 30 kilograms per meter squared), has_material_basis_in a multifactorial etiology related to excess nutrition intake, decreased caloric utilization, and genetic susceptibility, and possibly medications and certain disorders of metabolism, endocrine function, and mental illness." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypervitaminosis_d rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :nephrocalcinosis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dehydration ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :polyuria ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :irritability ],
        :overnutrition ;
    :has_definition "An overnutrition that is characterized by elevated vitamin D, which can subsequently cause high levels of calcium, has_symptom myalgia, fatigue, irritability, nausea, dehydration, polyuria, and nephrocalcinosis, and possibly has_material_basis_in excess intake of vitamin D." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypervitaminosis_a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :left_upper_quadrant_abdominal_rigidity ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anorexia ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :alopecia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :joint_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hepatomegaly ],
        :overnutrition ;
    :has_definition "An overnutrition that is characterized by excess vitamin A, has_symptom hepatomegaly, anorexia, fever, alopecia, and arthralgia, and has_material_basis_in excessive intake of vitaimin A, and/or derangement of vitamin A metabolism." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:substance_dependence rdfs:subClassOf :substance_related_disorder ;
    :has_definition "A substance-related disorder that involves the continued use of alcohol or other drugs despite problems related to use of the substance." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:drug_dependence rdfs:subClassOf :substance_dependence ;
    :has_definition "A substance dependence that involves the continued use of drugs despite problems related to use of the substance." .
